public class CheckOutput24 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 10;
		int y = -2;
		int z = ++x * y++;
		System.out.println("x = "+x);//11
		System.out.println("y = "+y);//-1
		System.out.println("z = "+z);//-22

	}

}
